import React, { Component } from "react";

import { SearchBar } from "./SearchBar";
import { List } from "./List";

export class InteractiveSection extends Component {
  state = {
    input: ""
  };

  render() {
    return (
      <div className="Interactive">
        <h3>Metroid Database</h3>
        <SearchBar />
        <List />
      </div>
    );
  }
}
